INSERT INTO `examseries` (`id`, `title`, `slug`, `category_id`, `is_paid`, `cost`, `validity`, `total_exams`, `total_questions`, `image`, `short_description`, `description`, `record_updated_by`, `start_date`, `end_date`, `created_at`, `updated_at`) VALUES
(1, 'Competitive Exam  Series', 'competitive-exam-series', 1, 1, '200.00', 30, 9, 110, '', '<p>A <strong>competitive examination</strong> is an <strong>examination</strong> where candidates are ranked according to their grades</p>\r\n', '<p>A <strong>competitive examination</strong> is an <strong>examination</strong> where candidates are ranked according to their grades. If the <strong>examination</strong> is open for n positions, then the first n candidates in ranks pass, the others are rejected. They are used as entrance <strong>examinations</strong> for university and college admissions or to secondary schools.</p>\r\n', 21753, '2016-11-14', '2030-12-31', '2016-11-14 11:46:40', '2016-11-19 19:01:25'),
(2, 'Groups Series', 'groups-series', 3, 0, '0.00', -1, 5, 51, '', '<p><strong>Groups</strong>- the alkali metals. The <strong>Groups</strong> elements in the periodic table are known as the alkali metals.</p>\r\n', '<p><strong>Groups</strong> - the alkali metals. The <strong>Groups </strong>elements in the periodic table are known as the alkali metals. They include lithium, sodium and potassium, which all react vigorously with water to produce an alkaline solution.</p>\r\n', 21753, '2016-11-14', '2030-12-31', '2016-11-14 11:50:17', '2016-11-14 11:50:31'),
(3, 'Gate Exam Series', 'gate-exam-series', 4, 1, '250.00', 30, 5, 68, '', '<p>The Graduate Aptitude <strong>Test</strong> in Engineering (<strong>GATE</strong>) is an all-India <strong>examination</strong></p>\r\n', '<p>The Graduate Aptitude <strong>Test</strong> in Engineering (<strong>GATE</strong>) is an all-India <strong>examination</strong> that primarily tests the comprehensive understanding of various undergraduate subjects in engineering and science. ... It is one of the most competitive <strong>examinations</strong> in India.</p>\r\n', 21753, '2016-11-14', '2030-12-31', '2016-11-14 11:51:47', '2016-11-14 11:52:47'),
(4, 'Average', 'average', 2, 1, '150.00', 25, 3, 26, '', '<p>Part of the Mathematics glossary: The&nbsp;<strong>arithmetic mean</strong>, also called the&nbsp;<strong>average</strong>&nbsp;or&nbsp;<strong>average</strong>&nbsp;value</p>\r\n', '<p>Part of the Mathematics glossary: The&nbsp;<strong>arithmetic mean</strong>, also called the&nbsp;<strong>average</strong>&nbsp;or&nbsp;<strong>average</strong>&nbsp;value, is the quantity obtained by summing two or more numbers or variables and then dividing by the number of numbers or variables. The&nbsp;<strong>arithmetic mean</strong>&nbsp;is important in statistics</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 11:18:20', '2016-11-19 19:01:55'),
(5, 'Numbers', 'numbers', 2, 1, '100.00', 20, 5, 47, '', '<p>The four elementary operations addition, subtraction, multiplication and division are commonly referred to as the four&nbsp;<strong>arithmetic</strong>&nbsp;operations,</p>\r\n', '<p>The four elementary operations addition, subtraction, multiplication and division are commonly referred to as the four&nbsp;<strong>arithmetic</strong>&nbsp;operations, even though the terms apply to operations on&nbsp;<strong>numbers</strong>&nbsp;other than integer, rational, or decimal and on mathematical objects of completely different kinds.</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 11:19:29', '2016-11-19 18:47:47'),
(6, 'Time and Distance', 'time-and-distance', 2, 1, '170.00', 30, 4, 35, '', '<p>Displacement. A displacement (see above) is a special kind of directed&nbsp;<em>distance</em>&nbsp;defined in mechanics</p>\r\n', '<p>Displacement. A displacement (see above) is a special kind of directed&nbsp;<em>distance</em>&nbsp;defined in mechanics. A directed&nbsp;<em>distance</em>&nbsp;is called displacement when it is the&nbsp;<em>distance</em>&nbsp;along a straight line (minimum&nbsp;<em>distance</em>) from A and B, and when A and B are positions occupied by the same particle at two different instants of&nbsp;<em>time</em>.</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 11:21:35', '2016-11-19 18:57:10'),
(8, 'Ages', 'ages', 2, 1, '180.00', 30, 4, 34, '', '<p>This is the&nbsp;<em>aptitude</em>&nbsp;questions and answers section on &quot;<em>Problems on Ages</em>&quot;</p>\r\n', '<p>This is the&nbsp;<em>aptitude</em>&nbsp;questions and answers section on &quot;<em>Problems on Ages</em>&quot; with&nbsp;<em>explanation</em>&nbsp;for various interview, competitive examination and entrance test.</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 11:26:53', '2016-11-19 18:56:40'),
(9, 'Arithmetic Aptitude', 'arithmetic-aptitude', 2, 1, '200.00', 30, 4, 41, '', '<p>The questions range from purely numeric calculations to problems of arithmetic reasoning,</p>\r\n', '<p>The questions range from purely numeric calculations to problems of arithmetic reasoning, graph and table reading, percentage analysis, categorization and&nbsp;<strong>quantitative</strong>&nbsp;analysis The&nbsp;<strong>quantitative aptitude</strong>&nbsp;test measures the numerical ability and accuracy in mathematical calculations.</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 11:29:06', '2016-11-19 18:53:28'),
(11, 'Software Series', 'software-series-1', 15, 1, '300.00', 40, 4, 56, '', '<p>Computer&nbsp;<strong>Software Definition</strong>.&nbsp;</p>\r\n', '<p>Computer&nbsp;<strong>Software Definition</strong>.&nbsp;<strong>Software</strong>&nbsp;is a generic term for organized collections of computer data and instructions, often broken into two major categories: system&nbsp;<strong>software</strong>&nbsp;that provides the basic non-task-specific functions of the computer, and application&nbsp;<strong>software</strong>&nbsp;which is used by users to accomplish specific tasks.</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 11:53:33', '2016-11-19 18:51:58'),
(15, 'General Science', 'general-science-1', 5, 1, '350.00', 50, 3, 35, '', '<p>According to Webster&#39;s New Collegiate Dictionary,&nbsp;</p>\r\n', '<p>According to Webster&#39;s New Collegiate Dictionary, the&nbsp;<strong>definition</strong>&nbsp;of&nbsp;<strong>science</strong>&nbsp;is: &quot;knowledge attained through study or practice,&quot; or. &quot;knowledge covering&nbsp;<strong>general</strong>truths of the operation of&nbsp;<strong>general</strong>&nbsp;laws, esp. as obtained and tested through scientific method [and] concerned with the physical world.&quot;</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 12:00:02', '2016-11-19 18:37:20'),
(16, 'Database Series', 'database-series', 14, 1, '350.00', 60, 2, 20, '', '<p>A&nbsp;<strong>database</strong>&nbsp;is a collection of information that is organized so that it can easily be accessed</p>\r\n', '<p>A&nbsp;<strong>database</strong>&nbsp;is a collection of information that is organized so that it can easily be accessed, managed, and updated. In one view, databases can be classified according to types of content: bibliographic, full-text, numeric, and images.</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 12:03:12', '2016-11-19 18:55:30'),
(17, 'Networking Series', 'networking-series', 10, 1, '400.00', 60, 3, 34, '', '<p>A&nbsp;<strong>network</strong>&nbsp;is defined as a group of two or more computer systems linked together.</p>\r\n', '<p>A&nbsp;<strong>network</strong>&nbsp;is defined as a group of two or more computer systems linked together. There are many types of computer&nbsp;<strong>networks</strong>, including the following: local-area&nbsp;<strong>networks</strong>&nbsp;(LANs): The computers are geographically close together (that is, in the same building).</p>\r\n', 21753, '2016-11-18', '2030-12-31', '2016-11-18 12:04:08', '2016-11-19 18:59:01');
