INSERT INTO `lmscategories` (`id`, `category`, `slug`, `image`, `description`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'Software Languages', 'software-languages', '', 'A programming language is a formal computer language or constructed language designed to communicate instructions to a machine, particularly a computer. Programming languages can be used to create programs to control the behavior of a machine or to express algorithms.', 21753, '2016-11-14 12:07:06', '2016-11-14 12:07:06'),
(2, 'Software Testing Tools', 'software-testing-tools', '', 'The Test Manager is an automated software testing tool is used in day to days testing activities. The Java programming language is used to develop this tool. Such Test Management tools are used to facilitate regular Software Development activities, automate & mange the testing activities', 21753, '2016-11-14 12:13:49', '2016-11-18 15:16:42'),
(3, 'Hardware&Networking', 'hardwarenetworking', '', 'Networking hardware, also known as network equipment or computer networking devices, are physical devices which are required for communication and interaction between devices on a computer network. Specifically, they mediate data in a computer network.', 21753, '2016-11-14 12:19:13', '2016-11-14 12:19:13');
