INSERT INTO `lmsseries` (`id`, `title`, `slug`, `is_paid`, `cost`, `validity`, `total_items`, `lms_category_id`, `image`, `short_description`, `description`, `start_date`, `end_date`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'PHP Language', 'php-language', 1, '250.00', 50, 3, 1, '', '<p><strong>PHP</strong> (recursive acronym for <strong>PHP</strong>: Hypertext Preprocessor)</p>\r\n', '<p><strong>PHP</strong> (recursive acronym for <strong>PHP</strong>: Hypertext Preprocessor) is a widely-used open source general-purpose scripting <strong>language</strong> that is especially suited for web development and can be embedded into HTML.</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:09:15', '2016-11-17 04:58:33'),
(2, 'C Language', 'c-language', 1, '150.00', 30, 2, 1, '', '<p>C is a computer programming language.</p>\r\n', '<p>C is a computer programming language. That means that you can use C to create lists of instructions for a computer to follow. C is one of thousands of programming languages currently in use.</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:10:12', '2016-11-17 04:57:28'),
(3, 'Java', 'java', 0, '0.00', -1, 2, 1, '', '<p><strong>Java</strong> is a general purpose, high-level programming <strong>language</strong> developed by Sun Microsystems.</p>\r\n', '<p><strong>Java</strong> is a general purpose, high-level programming <strong>language</strong> developed by Sun Microsystems. A small team of engineers, known as the Green Team, initiated the <strong>language</strong> in 1991. <strong>Java</strong> was originally called OAK, and was designed for handheld devices and set-top boxes.</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:11:00', '2016-11-17 04:58:13'),
(4, 'QTP', 'qtp', 1, '250.00', 30, 4, 2, '', '<p><strong>QTP</strong> stands for QuickTest Professional, a product of Hewlett Packard (HP).</p>\r\n', '<p><strong>QTP</strong> stands for QuickTest Professional, a product of Hewlett Packard (HP). This <strong>tool</strong> helps testers to perform an automated functional <strong>testing</strong> seamlessly without monitoring once script development is complete. HP <strong>QTP uses</strong> Visual Basic Scripting (VBScript) for automating the applications.</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:15:05', '2016-11-17 04:57:13'),
(5, 'Selenium', 'selenium', 0, '0.00', -1, 3, 2, '', '<p><strong>Selenium</strong> (software) <strong>Selenium</strong> is a portable software <strong>testing</strong> framework for web applications.</p>\r\n', '<p><strong>Selenium</strong> (software) <strong>Selenium</strong> is a portable software <strong>testing</strong> framework for web applications. <strong>Selenium</strong> provides a record/playback <strong>tool</strong> for authoring <strong>tests</strong> without learning a <strong>test</strong> scripting language (<strong>Selenium IDE</strong>).</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:15:59', '2016-11-17 04:55:51'),
(6, 'CCNA', 'ccna', 1, '300.00', 50, 3, 3, '', '<p>The 200-120 CCNA is the composite exam associated with the <strong>Cisco Certified Network Associate</strong> Routing &amp; Switching certification</p>\r\n', '<p>The 200-120 CCNA is the composite exam associated with the <strong>Cisco Certified Network Associate</strong> Routing &amp; Switching certification. This exam tests a candidate&#39;s knowledge and skills required to install, operate, and troubleshoot a small to medium size enterprise branch network.</p>\r\n', '2016-11-14', '2030-12-30', 21753, '2016-11-14 12:22:20', '2016-11-17 04:55:26'),
(7, ' Ethical Hacking', 'ethical-hacking', 1, '350.00', 60, 3, 3, '', '<p>An <strong>ethical</strong> hacker is a computer and networking expert who systematically attempts to penetrate a computer</p>\r\n', '<p>An <strong>ethical</strong> hacker is a computer and networking expert who systematically attempts to penetrate a computer system or network on behalf of its owners for the purpose of finding security vulnerabilities that a malicious hacker could potentially exploit.</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:23:49', '2016-11-17 04:55:13'),
(8, 'Network Security', 'network-security', 1, '350.00', 50, 3, 3, '', '<p>Network Security is the process of taking physical and software preventative measures to protect the underlying networking infrastructure from unauthorized access, misuse, malfunction,</p>\r\n', '<p>Network Security is the process of taking physical and software preventative measures to protect the underlying networking infrastructure from unauthorized access, misuse, malfunction, modification, destruction, or improper disclosure, thereby creating a secure platform for computers, users and programs to perform their permitted critical functions within a secure environment.</p>\r\n', '2016-11-14', '2030-12-31', 21753, '2016-11-14 12:25:52', '2016-11-17 04:54:59'),
(9, 'C++ Language', 'c-language-1', 1, '350.00', 60, 3, 1, '', '<p><strong>C++</strong>&nbsp;is an object oriented programming (OOP)&nbsp;<strong>language</strong>,</p>\r\n', '<p><strong>C++</strong>&nbsp;is an object oriented programming (OOP)&nbsp;<strong>language</strong>, developed by Bjarne Stroustrup, and is an extension of C&nbsp;<strong>language</strong>. It is therefore possible to code&nbsp;<strong>C++</strong>&nbsp;in a &quot;C style&quot; or &quot;object-oriented style.&quot; In certain scenarios, it can be coded in either way and is thus an effective example of a hybrid&nbsp;<strong>language</strong>.</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:14:37', '2016-11-18 16:50:39'),
(10, 'Python', 'python', 0, '0.00', -1, 3, 1, '', '<p><strong>Python</strong>&nbsp;is a widely used high-level, general-purpose, interpreted,</p>\r\n', '<p><strong>Python</strong>&nbsp;is a widely used high-level, general-purpose, interpreted, dynamic programming language. Its design philosophy emphasizes code readability, and its syntax allows programmers to express concepts in fewer lines of code than possible in languages such as C++ or Java.</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:18:41', '2016-11-18 16:50:15'),
(11, 'Ruby', 'ruby', 1, '250.00', 45, 3, 1, '', '<p>A&nbsp;<strong>ruby</strong>&nbsp;is a pink to blood-red colored gemstone, a variety</p>\r\n', '<p>A&nbsp;<strong>ruby</strong>&nbsp;is a pink to blood-red colored gemstone, a variety of the mineral corundum (aluminium oxide). The red color is caused mainly by the presence of the element chromium. Its name comes from ruber, Latin for red.</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:20:01', '2016-11-18 16:49:54'),
(12, 'Perl', 'perl', 1, '300.00', 45, 3, 1, '', '<p><strong>Perl</strong>&nbsp;is a script programming language that is similar in syntax</p>\r\n', '<p><strong>Perl</strong>&nbsp;is a script programming language that is similar in syntax to the C language and that includes a number of popular UNIX facilities such as sed, awk, and tr.&nbsp;<strong>Perl</strong>&nbsp;is an interpreted language that can optionally be compiled just before execution into either C code or cross-platform bytecode.</p>\r\n', '2016-11-18', '2016-11-18', 21753, '2016-11-18 15:22:45', '2016-11-18 16:49:30'),
(13, 'LoadRunner', 'loadrunner', 0, '0.00', -1, 4, 2, '', '<p>HPE&nbsp;<strong>LoadRunner</strong>&nbsp;is a software testing tool from Hewlett Packard Enterprise</p>\r\n', '<p>HPE&nbsp;<strong>LoadRunner</strong>&nbsp;is a software testing tool from Hewlett Packard Enterprise. It is used to test applications, measuring system behaviour and performance under load. HPE acquired&nbsp;<strong>LoadRunner</strong>&nbsp;as part of its acquisition of Mercury Interactive in November 2006</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:27:28', '2016-11-18 16:49:05'),
(14, 'Jmeter', 'jmeter', 1, '250.00', 60, 3, 2, '', '<p>Apache JMeter may be used to test performance both on static and dynamic resources (Webservices (SOAP/REST)</p>\r\n', '<p>Apache JMeter may be used to test performance both on static and dynamic resources (Webservices (SOAP/REST), Web dynamic languages - PHP, Java, ASP.NET, Files, etc. -, Java Objects, Data Bases and Queries, FTP Servers and more). It can be used to simulate a heavy load on a server, group of servers, network or object to test its strength or to analyze overall performance under different load types</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:30:24', '2016-11-18 16:48:35'),
(15, 'HP Quality Center/ALM', 'hp-quality-centeralm', 1, '400.00', 60, 3, 2, '', '<p><strong>HP</strong>&nbsp;Application Lifecycle Management (<strong>HP ALM</strong>) is a set of&nbsp;</p>\r\n', '<p><strong>HP</strong>&nbsp;Application Lifecycle Management (<strong>HP ALM</strong>) is a set of software tools developed and marketed by the&nbsp;<strong>HP</strong>&nbsp;Software Division of&nbsp;<strong>Hewlett Packard</strong>&nbsp;Enterprise for application development and testing. ... Other companies who produce application lifecycle management software include Micro Focus International, IBM. and others</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:36:27', '2016-11-18 16:47:56'),
(16, 'Automated Test Designer (ATD)', 'automated-test-designer-atd', 1, '300.00', 60, 3, 2, '', '<p><strong>Automated Test Designer</strong>, (<strong>ATD</strong>) is an easy to use windows client / server tool designed</p>\r\n', '<p><strong>Automated Test Designer</strong>, (<strong>ATD</strong>) is an easy to use windows client / server tool designed to create&nbsp;<strong>Test</strong>&nbsp;Cases,&nbsp;<strong>Test</strong>&nbsp;Data and&nbsp;<strong>Automated Test</strong>&nbsp;Scripts based on Requirements that uses a central repository.</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:39:06', '2016-11-18 16:47:36'),
(17, 'WebLOAD', 'webload', 1, '300.00', 60, 4, 2, '', '<p>Load testing tool&nbsp;<strong>WebLOAD</strong>&nbsp;combines performance, scalability, and integrity</p>\r\n', '<p>Load testing tool&nbsp;<strong>WebLOAD</strong>&nbsp;combines performance, scalability, and integrity as a single process for the verification of web and mobile applications. It can simulate hundreds of thousands of concurrent users making it possible to test large loads and report bottlenecks, constraints, and weak points within an application.</p>\r\n', '2016-11-18', '2030-12-31', 21753, '2016-11-18 15:44:38', '2016-11-18 16:51:07');
