INSERT INTO `notifications` (`id`, `title`, `slug`, `short_description`, `description`, `url`, `valid_from`, `valid_to`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'Combined Graduate Level Competitive Exam 2017', 'combined-graduate-level-competitive-exam-2017', 'Staff Selection Commission (SSC) is an organization controlled by Government of India', '<p>Staff Selection Commission (SSC) is an organization controlled by Government of India for the purpose of recruiting staff for various posts in various Ministries and reputed Departments of the Government of India and in their Subordinate Offices.</p>\r\n\r\n<p>- See more at: https://www.eduncle.com/ssc-cgl-recruitment-exam#sthash.NXqAm58d.dpuf</p>\r\n', '', '2016-11-17', '2017-06-30', 21753, '2016-11-17 05:20:25', '2016-11-17 05:20:25'),
(2, ' Probationary Officers', 'probationary-officers', 'Applications are invited from eligible Indian citizens for appointment as Probationary Officers (POs) in State Bank of India. Candidates selected are liable to be posted anywhere in India.', '<p>Applications are invited from eligible Indian citizens for appointment as Probationary Officers (POs) in State Bank of India. Candidates selected are liable to be posted anywhere in India.</p>\r\n\r\n<p>Any eligible candidate, who aspires to join State Bank of India as a Probationary Officer, is required to register online for the Recruitment Process. The examination will be held in two phases - preliminary and main. Candidates who will qualify in preliminary examination and shortlisted will have to appear for main examination and shortlisted candidates in the main examination will subsequently be called for a Group Discussion &amp; Interview.</p>\r\n\r\n<p>Prospective candidates will have to apply after carefully reading the advertisement regarding the process of examinations and interview, eligibility criteria, online registration processes, payment of prescribed application fee/intimation charges, pattern of examination, issuance of call letters etc. and ensure that they fulfil the stipulated criteria and follow the prescribed processes.</p>\r\n', 'https://www.talentsprint.com//misc/bank/notifications-pdf/sbi-po-2016.pdf', '2016-11-17', '2017-01-31', 21753, '2016-11-17 05:22:51', '2016-11-17 05:22:51'),
(3, 'Specialist Officer ', 'specialist-officer', 'Institute of Banking Personnel Selection (IBPS) has released a notification for the recruitment', '<p>Institute of Banking Personnel Selection (IBPS) has released a notification for the recruitment of 4122 Specialist Officers in nationalized banks and financial institutions through IBPS CRP SPL-VI examination. Interested candidates may check the eligibility criteria and apply online from 16-11-2016 to 02-12-2016.</p>\r\n', '', '2016-11-17', '2016-12-02', 21753, '2016-11-17 15:44:58', '2016-11-17 15:44:58'),
(4, 'Executives ', 'executives', 'IDBI Bank Limited has released a notification for the recruitment of 500 Executives. ', '<p>IDBI Bank Limited has released a notification for the recruitment of 500 Executives. Interested candidates may check the eligibility criteria and apply online from 16-11-2016 to 30-11-2016.</p>\r\n', '', '2016-11-17', '2016-11-30', 21753, '2016-11-17 15:46:18', '2016-11-17 15:46:18'),
(5, 'Police Constable', 'police-constable', 'Jammu & Kashmir Police has released a notification for the recruitment of 5381 Constable', '<p>Jammu &amp; Kashmir Police has released a notification for the recruitment of 5381 Constable in IRP Battalions, Executive Police and Armed Police. Interested candidates may check the eligibility criteria and apply online from 25-10-2016 to 20-11-2016.</p>\r\n', '', '2016-11-17', '2016-11-25', 21753, '2016-11-17 15:48:03', '2016-11-17 15:48:03'),
(6, 'RPF Recruitment 2015 Lady Constable 1599 jobs', 'rpf-recruitment-2015-lady-constable-1599-jobs', 'Railway protection force (RPF) is going to release a recruitment notification for the Recruitment of 1599 Lady Constable soon.', '<p><strong>RPF Recruitment Notification 2015 for 1599 Lady Constable</strong></p>\r\n\r\n<p>Railway protection force (RPF) is going to release a recruitment notification for the Recruitment of 1599 Lady Constable soon. Female candidates who want to grab this opportunity are requested to bookmark this link for latest updates on RPF Lady Constable vacancy.</p>\r\n', 'indianrailways.gov.in.', '2016-11-17', '2016-11-17', 21753, '2016-11-17 15:52:26', '2016-11-17 15:52:26');
