(5936, 17, 22, '', '4116c50ad766270', 'blanks', 'Who did Stone Cold Steve Austin wrestle at the 1998 edition of "Over the Edge"?', '', 0, 0, '', 1, '[{"answer":"Dude Love"}]', 2, 30, 'medium', '', 'Even though Mick Foley portrayed all of these gimmicks, he wrestled Stone Cold under Dude Love. The match had Vince McMahon as the referee. It started off as a regular match. Vince then changed it to No Holds Barred so Dude Love can use weapons. Finally he changed it to Falls Count Anywhere. That happened when Love had Austin knocked out while outside the ring. Since Vince is the owner and assigned himself as referee he could do what he wants. After all of that, Austin still retained his title that night.', NULL, 1, '2016-11-14 10:01:18', '2016-11-14 10:01:18'),
