(5976, 17, 20, '', 'c943e4f2862c35d', 'para', '<p>I felt the wall of the tunnel shiver. The master alarm squealed through my earphones. Almost simultaneously, Jack yelled down to me that there was a warning light on. Fleeting but spectacular sights snapped into ans out of view, the snow, the shower of debris, the moon, looming close and big, the dazzling sunshine for once unfiltered by layers of air. The last twelve hours before re-entry were particular bone-chilling. During this period, I had to go up in to command module. Even after the fiery re-entry splashing down in 81o water in south pacific, we could still see our frosty breath inside the command module.</p>\r\n', '', 0, 3, '[{"question":" The word \'Command Module\' used twice in the given passage indicates perhaps that it deals with ?","total_options":"4","options":[["an alarming journey","a commanding situation","a journey into outer space","a frightful battle."]]},{"question":" Which one of the following reasons would one consider as more as possible for the warning lights to be on?","total_options":"4","options":{"1":["There was a shower of debris.","Jack was yelling.","A catastrophe was imminent.","The moon was looming close and big."]}},{"question":"The statement that the dazzling sunshine was \\"for once unfiltered by layers of air\\" means ?","total_options":"4","options":{"2":["that the sun was very hot","that there was no strong wind","that the air was unpolluted","none of above"]}}]', 3, '[{"answer":"3"},{"answer":"3"},{"answer":"4"}]', 6, 15, 'easy', '', '<p>I felt the wall of the tunnel shiver. The master alarm squealed through my earphones. Almost simultaneously, Jack yelled down to me that there was a warning light on. Fleeting but spectacular sights snapped into ans out of view, the snow, the shower of debris, the moon, looming close and big, the dazzling sunshine for once unfiltered by layers of air. The last twelve hours before re-entry were particular bone-chilling. During this period, I had to go up in to command module. Even after the fiery re-entry splashing down in 81o water in south pacific, we could still see our frosty breath inside the command module.</p>\r\n', NULL, 1, '2016-11-14 10:56:40', '2016-11-14 10:56:40'),
(5977, 17, 20, '', '0bf06b8c9e46b9f', 'para', '<p>Organisations are institutions in which members compete for status and power. They compete for resource of the organisation, for example finance to expand their own departments, for career advancement and for power to control the activities of others. In pursuit of these aims, grouped are formed and sectional interests emerge. As a result, policy decisions may serve the ends of political and career systems rather than those of the concern. In this way, the goals of the organisation may be displaced in favour of sectional interests and individual ambition. These preoccupations sometimes prevent the emergence of organic systems. Many of the electronic firms in the study had recently created research and development departments employing highly qualified and well paid scientists and technicians. Their high pay and expert knowledge were sometimes seen as a threat to the established order of rank, power and privilege. Many senior managers had little knowledge of technicality and possibilities of new developments and electronics. Some felt that close cooperation with the experts in an organic system would reveal their ignorance and show their experience was now redundant.</p>\r\n', '', 0, 5, '[{"question":"The theme of the passage is ?","total_options":"4","options":[["groupism in organizations","individual ambitions in organizations","frustration of senior managers","emergence of sectional interests in organizations"]]},{"question":" \\"Organic system\\" as related to the organization implies its","total_options":"4","options":{"1":["growth with the help of expert knowledge","growth with input from science and technology","steady all around development","natural and unimpeded growth"]}},{"question":" Policy decision in organization would involve ?","total_options":"4","options":{"2":["cooperation at all levels in the organization","modernization of the organization","attracting highly qualified personnel","keeping in view the larger objectives of the organizations"]}},{"question":"The author makes out a case for ?","total_options":"4","options":{"3":["organic system","Research and Development in organisations","an understanding between senior and middle level executives","a refresher course for senior managers"]}},{"question":"The author tends to the senior managers as","total_options":"4","options":{"4":["ignorant and incompetent","a little out of step with their work environment","jealous of their younger colleagues","robbed of their rank, power and privilege"]}}]', 5, '[{"answer":"4"},{"answer":"2"},{"answer":"3"},{"answer":"1"},{"answer":"1"}]', 15, 20, 'hard', '', '<p>Organisations are institutions in which members compete for status and power. They compete for resource of the organisation, for example finance to expand their own departments, for career advancement and for power to control the activities of others. In pursuit of these aims, grouped are formed and sectional interests emerge. As a result, policy decisions may serve the ends of political and career systems rather than those of the concern. In this way, the goals of the organisation may be displaced in favour of sectional interests and individual ambition. These preoccupations sometimes prevent the emergence of organic systems. Many of the electronic firms in the study had recently created research and development departments employing highly qualified and well paid scientists and technicians. Their high pay and expert knowledge were sometimes seen as a threat to the established order of rank, power and privilege. Many senior managers had little knowledge of technicality and possibilities of new developments and electronics. Some felt that close cooperation with the experts in an organic system would reveal their ignorance and show their experience was now redundant.</p>\r\n', NULL, 1, '2016-11-14 11:01:41', '2016-11-14 11:01:41'),
