INSERT INTO `quizcategories` (`id`, `category`, `slug`, `image`, `description`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'SBI', 'sbi', '', 'State Bank of India (SBI) is an Indian multinational, public sector banking and financial services company. It is a government-owned corporation with its headquarters in Mumbai, Maharashtra.', 21753, '2016-11-14 10:20:37', '2016-11-14 10:20:37'),
(2, 'Aptitude', 'aptitude', '', 'Sawaalcom, Online learning solution for Job Seekers, Students and Competitive Exams. Quantitative aptitude test helps measure one\'s numerical capacity, problem solving and mathematical skills. Quantitative aptitude is found in almost all the entrance exams, competitive exams and placement exams.', 21753, '2016-11-14 10:21:54', '2016-11-18 11:13:31'),
(3, 'Groups', 'groups', '', 'A social group within social sciences has been defined as two or more people who interact with one another, share similar characteristics, and collectively have a sense of unity. Other theorists disagree however, and are wary of definitions which stress the importance of interdependence or objective similarity.', 21753, '2016-11-14 11:09:30', '2016-11-14 11:09:30'),
(4, 'Gate', 'gate', '', 'Graduate Aptitude Test in Engineering (GATE) is an all India examination that primarily tests the comprehensive understanding of various undergraduate subjects in Engineering and Technology. GATE is conducted jointly by the Indian Institute of Science and seven IITs (IIT Bombay, IIT Delhi, IIT Guwahati, IIT Kanpur, IIT Kharagpur, IIT Madras and IIT Roorkee) on behalf of the National Coordination Board – GATE, Department of Higher Education, Ministry of Human Resource Development (MHRD), and Government of India.', 21753, '2016-11-14 11:16:56', '2016-11-14 11:16:56'),
(5, ' General Knowledge', 'general-knowledge', '', 'General knowledge is an important component of crystallized intelligence and is strongly associated with general intelligence, and with openness to experience. Studies have found that people who are highly knowledgeable in a particular domain tend to be knowledgeable in many.', 21753, '2016-11-14 11:19:16', '2016-11-14 11:19:16'),
(10, 'Networking', 'networking', '', 'Networking based  Quizzes ', 21753, '2016-11-18 10:53:30', '2016-11-19 18:24:08'),
(11, 'SCIENCE ', 'science', '', 'Science and/or nature quiz rounds.', 21753, '2016-11-18 10:53:55', '2016-11-19 18:31:50'),
(12, 'Mathes', 'mathes', '', 'Quiz rounds on mathes', 21753, '2016-11-18 10:54:20', '2016-11-19 17:38:57'),
(13, 'Competitive', 'competitive', '', 'Quiz rounds on competitive', 21753, '2016-11-18 10:54:37', '2016-11-19 17:55:54'),
(14, 'Database', 'database', '', 'Quizzes round on Database', 21753, '2016-11-18 10:55:12', '2016-11-19 17:35:11'),
(15, 'Software', 'software', '', 'Quizzes  on Software Courses.', 21753, '2016-11-18 10:58:19', '2016-11-19 17:32:43');
