(1, 'Aptitude Quiz', 'aptitude-quiz', 20, 2, 1, '100.00', 25, '21.00', 1, '1.00', '50.00', '', 1, 'Sawaalcom, Online learning solution for Job Seekers, Students and Competitive Exams. Quantitative aptitude test helps measure one\'s numerical capacity, problem solving and mathematical skills. Quantitative aptitude is found in almost all the entrance exams, competitive exams and placement exams.', 6, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 10:23:12', '2016-11-14 10:25:28'),
(2, 'Quiz on Quant', 'quiz-on-quant', 15, 2, 0, '0.00', -1, '28.00', 0, '0.00', '50.00', '', 1, 'Sawaalcom, Online learning solution for Job Seekers, Students and Competitive Exams. Quantitative aptitude test helps measure one\'s numerical capacity, problem solving and mathematical skills. Quantitative aptitude is found in almost all the entrance exams, competitive exams and placement exams.', 8, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 10:28:41', '2016-11-14 10:29:42'),
(3, 'SBI PO', 'sbi-po', 25, 1, 1, '150.00', 30, '35.00', 1, '1.00', '50.00', '', 1, 'State Bank of India is an Indian multinational, public sector banking and financial services company. It is a government-owned corporation with its headquarters in Mumbai, Maharashtra', 12, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 10:31:30', '2016-11-14 11:07:07'),
(4, 'SBI Cleark', 'sbi-cleark', 30, 1, 0, '0.00', -1, '41.00', 0, '0.00', '50.00', '', 1, 'State Bank of India is an Indian multinational, public sector banking and financial services company. It is a government-owned corporation with its headquarters in Mumbai, Maharashtra', 14, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 10:33:03', '2016-11-14 11:06:46'),
(5, 'Group I', 'group-i', 25, 3, 1, '200.00', 30, '27.00', 0, '0.00', '50.00', '', 1, 'A social group within social sciences has been defined as two or more people who interact with one another, share similar characteristics, and collectively have a sense of unity. Other theorists disagree however, and are wary of definitions which stress the importance of interdependence or objective similarity.', 10, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 11:10:22', '2016-11-14 11:11:14'),
(6, 'Group II', 'group-ii', 30, 3, 1, '150.00', 30, '35.00', 1, '1.00', '55.00', '', 1, 'A social group within social sciences has been defined as two or more people who interact with one another, share similar characteristics, and collectively have a sense of unity. Other theorists disagree however, and are wary of definitions which stress the importance of interdependence or objective similarity.', 12, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 11:11:58', '2016-11-14 11:12:44'),
(7, 'Group III', 'group-iii', 30, 3, 1, '250.00', 35, '47.00', 1, '1.00', '60.00', '', 1, 'A social group within social sciences has been defined as two or more people who interact with one another, share similar characteristics, and collectively have a sense of unity. Other theorists disagree however, and are wary of definitions which stress the importance of interdependence or objective similarity.', 15, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 11:14:29', '2016-11-14 11:15:09'),
(8, 'Quiz on Gate', 'quiz-on-gate', 30, 4, 1, '200.00', 30, '64.00', 1, '1.00', '50.00', '', 1, 'Graduate Aptitude Test in Engineering (GATE) is an all India examination that primarily tests the comprehensive understanding of various undergraduate subjects in Engineering and Technology. GATE is conducted jointly by the Indian Institute of Science and seven IITs (IIT Bombay, IIT Delhi, IIT Guwahati, IIT Kanpur, IIT Kharagpur, IIT Madras and IIT Roorkee) on behalf of the National Coordination Board – GATE, Department of Higher Education, Ministry of Human Resource Development (MHRD), and Government of India.', 18, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 11:18:01', '2016-11-14 11:22:22'),
(9, 'Quiz on GK', 'quiz-on-gk', 25, 5, 1, '200.00', 30, '54.00', 1, '1.00', '50.00', '', 1, 'General knowledge is an important component of crystallized intelligence and is strongly associated with general intelligence, and with openness to experience. Studies have found that people who are highly knowledgeable in a particular domain tend to be knowledgeable in many.', 16, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 11:20:30', '2016-11-14 11:47:43'),
(10, 'Gate', 'gate', 50, 4, 1, '250.00', 30, '72.00', 0, '0.00', '50.00', '', 1, 'Graduate Aptitude Test in Engineering (GATE) is an all India examination that primarily tests the comprehensive understanding of various undergraduate subjects in Engineering and Technology. GATE is conducted jointly by the Indian Institute of Science and seven IITs (IIT Bombay, IIT Delhi, IIT Guwahati, IIT Kanpur, IIT Kharagpur, IIT Madras and IIT Roorkee) on behalf of the National Coordination Board – GATE, Department of Higher Education, Ministry of Human Resource Development (MHRD), and Government of India.', 20, 1, '2016-11-14', '2030-12-31', 21753, '2016-11-14 11:21:31', '2016-11-14 11:23:17'),
