INSERT INTO `topics` (`id`, `subject_id`, `parent_id`, `topic_name`, `slug`, `description`, `sort_order`, `created_at`, `updated_at`) VALUES
(20, 17, 0, 'General Science', 'general-science', 'The General Science program provides students with a strong foundation in both science and mathematics. This program of study is appropriate for students interested in studying health-related careers, pre-pharmacy, biology, physical science or pre-engineering.', 1, '2016-11-11 10:29:50', '2016-11-11 10:29:50'),
(21, 17, 0, 'Indian History', 'indian-history', 'The name India is derived from Indus, which originates from the Old Persian word Hindu. The latter term stems from the Sanskrit word Sindhu, which was the historical local appellation for the Indus River. The ancient Greeks referred to the Indians as Indoi , which translates as "The people of the Indus".', 1, '2016-11-11 10:30:51', '2016-11-11 10:30:51'),
(22, 17, 0, 'Sports', 'sports', 'Sport. Sport in childhood. ... Sport (UK) or sports (US) are all forms of usually competitive physical activity or games which, through casual or organised participation, aim to use, maintain or improve physical ability and skills while providing enjoyment to participants, and in some cases, entertainment for spectators', 1, '2016-11-11 10:31:25', '2016-11-11 10:31:25'),
(23, 17, 0, 'Indian Politics', 'indian-politics', 'Indian Politics refers to the activities of the political parties associated with the governance of India as a country. A Politician is person who is professionally involved in politics. Usually, he has good influence over the general people. It is often said that politics is the art and technique of government.', 1, '2016-11-11 10:32:17', '2016-11-11 10:32:17'),
(24, 18, 0, 'C Programming', 'c-programming', 'C is a high-level and general purpose programming language that is ideal for developing firmware or portable applications. Originally intended for writing system software, C was developed at Bell Labs by Dennis Ritchie for the Unix Operating System (OS) in the early 1970s.', 1, '2016-11-11 10:33:10', '2016-11-11 10:33:10'),
(25, 18, 0, 'C++ Programming', 'c-programming-1', 'C++ is an object oriented programming (OOP) language, developed by Bjarne Stroustrup, and is an extension of C language. It is therefore possible to code C++ in a "C style" or "object-oriented style." In certain scenarios, it can be coded in either way and is thus an effective example of a hybrid language.', 1, '2016-11-11 10:33:45', '2016-11-11 10:33:45'),
(26, 18, 0, 'C# Programming', 'c-programming-2', 'C# (pronounced "C-sharp") is an object-oriented programming language from Microsoft that aims to combine the computing power of C++ with the programming ease of Visual Basic. C# is based on C++ and contains features similar to those of Java.', 1, '2016-11-11 10:34:27', '2016-11-11 10:34:27'),
(27, 18, 0, 'Java Programming', 'java-programming', 'Java is a general-purpose computer programming language that is concurrent, class-based, object-oriented, and specifically designed to have as few implementation dependencies as possible.', 1, '2016-11-11 10:34:59', '2016-11-11 10:34:59'),
(28, 19, 0, 'Arithmetic Aptitude', 'arithmetic-aptitude', 'The questions range from purely numeric calculations to problems of arithmetic reasoning, graph and table reading, percentage analysis, categorization and quantitative analysis The quantitative aptitude test measures the numerical ability and accuracy in mathematical calculations.', 1, '2016-11-11 10:36:06', '2016-11-11 10:36:06'),
(29, 19, 0, 'Data Interpretation', 'data-interpretation', 'Interpretation is the process of making sense of numerical data that has been collected, analyzed, and presented. ... A common method of assessing numerical data is known as statistical analysis , and the activity of analyzing and interpreting data in order to make predictions is known as inferential statistics ', 1, '2016-11-11 10:36:49', '2016-11-11 10:36:49'),
(30, 19, 28, 'Problems on Trains', 'problems-on-trains-1', '', 1, '2016-11-18 12:26:06', '2016-11-18 12:26:19'),
(31, 19, 28, 'Height and Distance', 'height-and-distance', '', 1, '2016-11-18 12:26:48', '2016-11-18 12:26:48'),
(32, 19, 28, 'Simple Interest', 'simple-interest', 'The simple interest formula allows us to calculate I, which is the interest earned or charged on a loan. According to this formula, the amount of interest is given by I = Prt, where P is the principal, r is the annual interest rate in decimal form, and t is the loan period expressed in years', 1, '2016-11-18 12:27:19', '2016-11-18 12:27:19'),
(33, 19, 28, 'Time and Distance', 'time-and-distance', 'Distance is a numerical description of how far apart objects are. In physics or everyday usage, distance may refer to a physical length, or an estimation based on other criteria (e.g. "two counties over").', 1, '2016-11-18 12:27:50', '2016-11-18 12:27:50'),
(34, 19, 28, 'Time and Work', 'time-and-work', '', 1, '2016-11-18 12:28:23', '2016-11-18 12:28:23'),
(35, 19, 28, 'Average', 'average', 'In colloquial language, an average is the sum of a list of numbers divided by the number of numbers in the list. In mathematics and statistics, this would be called the arithmetic mean. In statistics, mean, median, and mode are all known as measures of central tendency.', 1, '2016-11-18 12:30:08', '2016-11-18 12:30:08'),
(36, 19, 28, 'Numbers ', 'numbers', 'A number is a mathematical object used to count, measure, and label. [citation needed] The original examples are the natural numbers 1, 2, 3, and so forth. A notational symbol that represents a number is called a numeral.', 1, '2016-11-18 12:30:49', '2016-11-18 12:30:49'),
(37, 17, 0, 'Indian Economy', 'indian-economy', 'The economy of India is the seventh-largest economy in the world measured by nominal GDP and the third-largest by purchasing power parity (PPP). ... And the outlook for short-term growth is also good as according to the IMF, the Indian economy is the "bright spot" in the global landscape.', 1, '2016-11-18 12:31:38', '2016-11-18 12:31:38'),
(38, 17, 0, 'Indian Culture', 'indian-culture', 'India\'s languages, religions, dance, music, architecture, food, and customs differs from place to place within the country. The Indian culture, often labeled as an amalgamation of several cultures, spans across the Indian subcontinent and has been influenced by a history that is several millennia old.', 1, '2016-11-18 12:32:21', '2016-11-18 12:32:21'),
(39, 17, 0, 'World Geography', 'world-geography', 'Geography (from Greek γεωγραφία, geographia, literally "earth description") is a field of science devoted to the study of the lands, the features, the inhabitants, and the phenomena of Earth. ... Geography has been called "the world discipline" and "the bridge between the human and the physical science".', 1, '2016-11-18 12:32:56', '2016-11-18 12:32:56'),
(40, 20, 0, 'Logical Reasoning', 'logical-reasoning', 'Given a precondition or premise, a conclusion or logical consequence and a rule or material conditional that implies the conclusion given the precondition, one can explain that: ... Mathematical logic and philosophical logic are commonly associated with this type of reasoning.', 1, '2016-11-18 12:36:49', '2016-11-18 12:36:49'),
(41, 20, 40, 'Verbal Classification', 'verbal-classification', '', 1, '2016-11-18 12:37:26', '2016-11-18 12:37:26'),
(42, 20, 40, 'Verbal Reasoning', 'verbal-reasoning', 'Verbal reasoning is understanding and reasoning using concepts framed in words. It aims at evaluating ability to think constructively, rather than at simple fluency or vocabulary recognition.', 1, '2016-11-18 12:38:03', '2016-11-18 12:38:03'),
(43, 20, 40, 'Matching Definitions', 'matching-definitions', 'Definition of match. 1 a : a person or thing equal or similar to another b : one able to cope with another c : an exact counterpart. 2 : a pair suitably associated <carpet and curtains are a match>', 1, '2016-11-18 12:38:49', '2016-11-18 12:38:49'),
(44, 20, 40, 'Cause and Effect', 'cause-and-effect', 'Without the alarm, you probably would have overslept. In this scenario, the alarm had the effect of you waking up at a certain time. This is what we mean by cause and effect. A cause-effect relationship is a relationship in which one event (the cause) makes another event happen (the effect)', 1, '2016-11-18 12:39:38', '2016-11-18 12:39:38'),
(45, 21, 0, 'Trigonometric ', 'trigonometric', 'In mathematics, the trigonometric functions (also called the circular functions) are functions of an angle. They relate the angles of a triangle to the lengths of its sides. Trigonometric functions are important in the study of triangles and modeling periodic phenomena, among many other applications.', 1, '2016-11-18 12:42:18', '2016-11-18 12:42:18'),
(46, 21, 0, 'Algebra', 'algebra', 'Definition of algebra for Students. : a branch of mathematics in which symbols (as letters and numbers) are combined according to the rules of arithmetic.', 1, '2016-11-18 12:43:26', '2016-11-18 12:43:26'),
(47, 22, 0, 'Nouns', 'nouns', 'A noun is a part of speech that is used to name a person, place, thing, quality, or action. A noun can function as a subject, object, complement, appositive, or object of a preposition.', 1, '2016-11-18 12:52:05', '2016-11-18 12:52:05'),
(48, 22, 0, 'Verbs', 'verbs', 'A verb, from the Latin verbum meaning word, is a word (part of speech) that in syntax conveys an action (bring, read, walk, run, learn), an occurrence (happen, become), or a state of being (be, exist, stand). In the usual description of English, the basic form, with or without the particle to, is the infinitive', 1, '2016-11-18 12:52:36', '2016-11-18 12:52:36'),
(49, 22, 0, 'Adjectives', 'adjectives', 'An adjective is a word that modifies a noun (or pronoun) to make it more specific: a "rotten" egg, a "cloudy" day, a "lovely" lady, or a "tall," "cool" glass of water. You use adjectives to give your nouns a little attitude or to communicate clearly.', 1, '2016-11-18 12:53:10', '2016-11-18 12:53:10'),
(50, 22, 0, 'Tenses', 'tenses', 'A tense is a form taken by a verb to show the time of an action. There are three main tenses: Present tense: things that are true when the words are spoken or written; or are generally true; or for some languages will be true in the future.\r\n', 1, '2016-11-18 12:54:28', '2016-11-18 12:54:28'),
(52, 23, 0, 'Motion and forces', 'motion-and-forces', 'Motion (physics) In physics, motion is a change in position of an object over time. Motion is typically described in terms of displacement, distance, velocity, acceleration, time and speed. ... An object\'s motion cannot change unless it is acted upon by a force, as described.', 1, '2016-11-18 13:11:53', '2016-11-18 13:11:53'),
(53, 23, 0, 'Conservation of energy and momentum', 'conservation-of-energy-and-momentum', 'They are sometimes called "constants of the motion". These quantities are said to be "conserved" and the conservation laws which result can be considered to be the most fundamental principles of mechanics. In mechanics, examples of conserved quantities are energy, momentum, and angular momentum.', 1, '2016-11-18 13:14:14', '2016-11-18 13:14:14'),
(54, 24, 0, 'Matter', 'matter', 'Matter is a substance that has inertia and occupies physical space. According to modern physics, matter consists of various types of particles, each with mass and size.', 1, '2016-11-18 13:17:16', '2016-11-18 13:17:16'),
(55, 24, 0, 'Phase', 'phase', 'A distinct stage of development: “The American occupation of Japan fell into three successive phases” (Edwin O. Reischauer). A temporary manner, attitude, or pattern of behavior: just a passing phase. An aspect; a part: We must reconsider every phase of the operation. a.', 1, '2016-11-18 13:17:51', '2016-11-18 13:17:51'),
(56, 24, 0, 'Reaction', 'reaction', 'A synthesis reaction or direct combination reaction is a type of chemical reaction in which two or more simple substances combine to form a more complex product. The reactants may be elements or compounds. The product is always a compound', 1, '2016-11-18 13:18:30', '2016-11-18 13:18:30'),
(57, 25, 0, 'Multitasking', 'multitasking', 'Multitasking, in an operating system, is allowing a user to perform more than one computer task (such as the operation of an application program) at a time. The operating system is able to keep track of where you are in these tasks and go from one to the other without losing information.', 1, '2016-11-18 13:19:56', '2016-11-18 13:19:56'),
(58, 25, 0, 'Memory management', 'memory-management', 'Memory management is the act of managing computer memory at the system level. The essential requirement of memory management is to provide ways to dynamically allocate portions of memory to programs at their request, and free it for reuse when no longer needed', 1, '2016-11-18 13:20:49', '2016-11-18 13:20:49'),
(59, 26, 0, 'Joins', 'joins', 'SQL JOIN. An SQL JOIN clause is used to combine rows from two or more tables, based on a common field between them. The most common type of join is: SQL INNER JOIN (simple join). An SQL INNER JOIN returns all rows from multiple tables where the join condition is met.', 1, '2016-11-18 13:22:12', '2016-11-18 13:22:12'),
(60, 26, 0, 'Sql Commands', 'sql-commands', 'SQL commands are instructions, coded into SQL statements, which are used to communicate with the database to perform specific tasks, work, functions and queries with data. ... Data Definition Language (DDL) - These SQL commands are used for creating, modifying, and dropping the structure of database objects.', 1, '2016-11-18 13:23:13', '2016-11-18 13:23:13'),
(61, 27, 0, 'JS Operators', 'js-operators', 'Like other computer language, JavaScript lets you perform operations on pieces of data. A lot of the operators are ones you already know! (Unary negation, subtraction) As a unary operator, negates the value of its argument. As a binary operator, subtracts 2 numbers.', 1, '2016-11-18 13:24:18', '2016-11-18 13:24:18'),
(62, 27, 0, 'JS Variables', 'js-variables', '', 1, '2016-11-18 13:25:04', '2016-11-18 13:25:04'),
(63, 28, 0, 'Switches', 'switches', 'A network switch (also called switching hub, bridging hub, officially MAC bridge) is a computer networking device that connects devices together on a computer network, by using packet switching to receive, process and forward data to the destination device', 1, '2016-11-18 13:26:13', '2016-11-18 13:26:13'),
(64, 28, 0, 'Routers', 'routers', 'A router is a device that forwards data packets along networks. A router is connected to at least two networks, commonly two LANs or WANs or a LAN and its ISP\'s network. Routers are located at gateways, the places where two or more networks connect.', 1, '2016-11-18 13:26:50', '2016-11-18 13:26:50');
